import React from 'react'
import {Field, reduxForm} from "redux-form";

class StreamCreate extends React.Component {
    renderTextInput(formProps) {
        return (
            <input  value={formProps.input.value}/>
        )
    }

    render() {
        // console.log(this.props)
        return (
            <form>
                <Field name="title" component={this.renderTextInput} onChange={formProps.input.onChange}/>
                <Field name="description" component={this.renderTextInput} onChange={formProps.input.onChange}/>
            </form>
        )
    }
}

export default reduxForm({
    form: 'streamCreate'
})(StreamCreate)
